// SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "../interfaces/IAdmealNFT.sol";

/**
 * @title NFT Sale Contract
 */
contract NFTSale is ReentrancyGuard, Ownable {
    event TokenBought(address indexed buyer, uint256 amount, string currency);

    // Admal NFT Object
    IAdmealNFT public token;

    // Status of the sale
    bool public isEnabled;

    // Price of Admeal NFT
    uint256 public tokenPrice = 0.0001 ether;

    // Max supply
    uint256 public maxSupply = 5000;

    // Current supply
    uint256 public totalSupply = 0;

    mapping(address => bool) public whitelist;

    modifier whenEnabled() {
        require(isEnabled, "NFTSale: Sale is disabled");
        _;
    }

    modifier isWhiteListed() {
        require(whitelist[msg.sender], "NFTSale: not in whitelist");
        _;
    }

    /**
     * @dev Constructor function
     */
    constructor(IAdmealNFT _token) {
        token = _token;
    }

    /**
     * @dev Buy Admeal NFT in ETH
     */
    function buyInETH(
        uint256 _amount
    ) external payable nonReentrant whenEnabled isWhiteListed {
        require(
            msg.value == tokenPrice * _amount,
            "NFTSale: value is not same as the token price"
        );

        require(totalSupply + _amount <= maxSupply, "NFTSale: no tokens left");

        token.mint(msg.sender, 0, _amount);
        totalSupply += _amount;

        emit TokenBought(msg.sender, _amount, "ETH");
    }

    /**
     * @dev Enable or disable sale
     */
    function toggleSale(bool _isEnabled) external onlyOwner {
        isEnabled = _isEnabled;
    }

    /**
     * @dev Set token price
     */
    function setTokenPrice(uint256 _tokenPrice) external onlyOwner {
        tokenPrice = _tokenPrice;
    }

    /**
     * @dev Set max supply
     */
    function setMaxSupply(uint256 _maxSupply) external onlyOwner {
        maxSupply = _maxSupply;
    }

    /**
     * @dev Add to whitelist
     */
    function addToWhitelist(
        address[] calldata toAddAddresses
    ) external onlyOwner {
        for (uint i = 0; i < toAddAddresses.length; i++) {
            whitelist[toAddAddresses[i]] = true;
        }
    }

    /**
     * @dev Remove from whitelist
     */
    function removeFromWhitelist(
        address[] calldata toRemoveAddresses
    ) external onlyOwner {
        for (uint i = 0; i < toRemoveAddresses.length; i++) {
            delete whitelist[toRemoveAddresses[i]];
        }
    }
